import React, { useState } from 'react';
import About from '../About';
import Portfolio from '../Portfolio';
import ContactForm from '../Contact';

function Nav(props) {

  const [ currentPage, setCurrentPage ] = useState('Portfolio');

  const renderPage = () => {
    switch(currentPage) {
      case "Portfolio":
        return <Portfolio/>;
        case "About":
        return <About/>;
        case "Resume":
        return <Resume/>;
        case "Contact":
        return <ContactForm/>;
        default:
          return <h1>404 not found</h1>;


    }
}
  return (
    <header className="flex-row px-1">
      <h2>
        <a data-testid="link" onClick={()=> setCurrentPage('Portfolio')}>
        Devin Pask Portfolio
        </a>
      </h2>
      <nav>
        <ul className="flex-row">
          <li className="mx-2">
            <a data-testid="about" onClick={()=> setCurrentPage('About')}>
              About Me
            </a>
          </li>
          <li className="mx-2">
            <a data-testid="portfoio" onClick={()=> setCurrentPage('Portfolio')}>
              Portfolio
            </a>
          </li>
          <li className="mx-2">
            <a data-testid="resume" onClick={()=> setCurrentPage('Resume')}>
              Resume
            </a>
          </li>
          <li className="mx-2">
          <a data-testid="contact" onClick={()=> setCurrentPage('Contact')}>
              Contact
            </a>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Nav;
